import React from "react";
import InventoyHeader from "../InventoryHeader/InventoyHeader";

function AddNewInventory() {
  return (
    <div>
      <InventoyHeader />
      <div>
        <from>
          <div className="">
            <div className="flex flex-col w-72 g-2 al">
              <lable className="p-3 m-0">Product Name</lable>
              <input
                type="text"
                placeholder="Product Name"
                className="border-2 p-3 rounded-lg  m-2"
              />
            </div>
          </div>
        </from>
      </div>
    </div>
  );
}
export default AddNewInventory;
